export const enum POSTER {
  COUPON_TYPE = 1,
  QRCODE_TYPE = 2
}
export const enum ACTIVITY_POSTER {
  POSTER_TYPE = 1,
  QRCODE_TYPE = 2
}
export const enum ACTIVITY_STATUS {
  PUBLISHED = 1,
  END = 3,
  DRAFT = 4,
  CANCELED = 5
}
